import React from "react";

const CourseRow = ({props}) => (

  <div class="row border justify-content-between">
    <div class="col-6">

        {props.name}
    </div>
    <div class="d-none d-sm-block col-2 text-center">{props.owner}</div>
    <div class="d-none d-sm-block col-2 text-center">{props.modifiedDate}</div>
    <div class="col-2 text-right">X</div>
  </div>
);

export default CourseRow;
